export class Goal {
    constructor(name, id, status, color){
        this.name = name;
        this.id = id;
        this.status = status;
        this.color = color;
    }
}

export function readGoals(project){
    return project.goals ? project.goals.map((goal, id) => {
        var colorId = goal.color && (project.goalColors.find(color => color.name === goal.color)) ? project.goalColors.find(color => color.name === project.goalColors[goal.colorId].name).id : 0;
        console.log(goal);
        return (new Goal(goal.name, id, goal.status, project.goalColors[colorId]));
    }) : [];
}
